import React, { Component } from 'react';
import './../css/App.css';
import Nav from './Nav';
import Home from './Home';
import Footer from './Footer';
import News from './News';

class App extends Component {
  render() {
    return (
      <div>
        <Nav/>
        {/* <Home/> */}
        <News/>
        <Footer/>
      </div>
    );
  }
}

export default App;
